import React, {Component} from 'react';
import './App.css';

export default class App extends Component {
  constructor() {
    super();
  };


  render() {
    return (
      <div className="App">
       {this.state.monsters.map(monsters => <h1 key={monsters.id}>{monsters.name}</h1>)
       }
      </div>
    );
  }
}
